    [],nt"revision_timestamp": "2015-06-19T15:39:00.211641",nt"name": "digital-flood-insurance-rate-map-database-tuscaloosa-county-alabama-and-incorporated-areas",nt"isopen":
    false,nt"url": null,nt"notes": "The Digital Flood Insurance Rate Map (DFIRM)
    Database depicts flood risk information and supporting data used to develop the
    risk data. The primary risk classifications used are the 1-percent-annual-chance
    flood event, the 0.2-percent-annual- chance flood event, and areas of minimal flood
    risk. The DFIRM Database is derived from Flood Insurance Studies (FISs), previously
    published Flood Insurance Rate Maps (FIRMs), flood hazard analyses performed in
    support of the FISs and FIRMs, and new mapping data, where available. The FISs and
    FIRMs are published by the Federal Emergency Management Agency (FEMA). The file
    is georeferenced to earth's surface using UTM projection and corrdinate system in
    the North American Vertical Datum of 1988 (NAVD88). Horizontal information was compiled
    on the North American Datum of 1983 (NAD83), the specifications for the horizontal
    control of DFIRM data files are consistent with those required for mapping at a
    scale of 1:6,000; 1:12,000; 1:24,000.",nt"license_title": null,nt"extras":
